window.bookSummaryJSON = "<p><b>Our heroes have escaped with the ancient dragon gate, rekindling their hope of finding allies on other worlds, but powerful enemies are right behind them.</b></p> <p>Unfortunately, Jak and Jadora must decipher the gate’s secrets before they can use it.</p> <p>That’s a difficult task with mages from numerous kingdoms hunting them, Lord Malek stalking Jadora through magical dreams, and a new threat lurking deep within the jungle.</p> <p>Faced by overwhelming odds, Jak and Jadora may be forced to work with the only man who can keep them alive: Malek.</p> <p>But what price will they have to pay for his protection?</p>"; 
